import React from "react";

export default function TodoItem(props) {
    return (
        <li>
            <span>
                <input type="checkbox"/>
                <strong>{props.index + 1}.</strong>
                &nbsp;
                {props.item.title}
            </span>
            <button>&times;</button>
        </li>
    )
}
